    const {cart}=useContext(productcontext);
    if(cart.getitems.product_id===0){}
    
    const items = cart.getitems.product_id;
  return (
    <>
      { items.map((item)=>{

     return <Cartitem key={item._id} item={item}/>


      })}
    </>
  )
}
